import React from 'react';
import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    villes: []
  }

  componentDidMount() {
    axios.get(`http://localhost:8081/?pollutionHourtin=35`)
      .then(res => {
        const villes = res.data;
        this.setState({ villes });
      })
  }

  render() {
    return (
      <ul>
        {
          this.state.villes.map(hourtin_values => <li key = {hourtin_values.pollutionHourtin}>{hourtin_values.pollutionHourtin}</li>)
        }
      </ul>
    )
  }
}
